import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import CheckPopup from './CheckPopup';
import './DataPreparation.css';

const DataPreparation = () => {
    const [misclassifiedCells, setMisclassifiedCells] = useState({});
    const [selectedLines, setSelectedLines] = useState({});
    const [selectedImages, setSelectedImages] = useState([]);
    const [isPopupOpen, setIsPopupOpen] = useState(false);
    // useEffect(() => {
    //     const fetchData = async () => {
    //         const data = await fetchPairs('http://localhost:8000/api/pairs', {});
    //         // Set the fetched data to state
    //         setMisclassifiedCells(data);
    //     };

    //     fetchData();
    // }, []); // Empty dependency array ensures this effect runs only once after initial render

    // const fetchPairs = async (path, body) => {
    //     const response = await fetch(path, {
    //         method: 'POST',
    //         headers: {
    //             'Content-Type': 'application/json',
    //         },
    //         body: JSON.stringify(body),
    //     });
    //     const data = await response.json();
    //     return data;
    // };
    // const fetchPairs = async (path, body) => {
    //     const response = await fetch(`http://localhost:8000/api/pairs`, {
    //         method: 'POST',
    //         headers: {
    //             'Content-Type': 'application/json',
    //         },
    //         body: JSON.stringify(body),
    //     });
    //     const data = await response.json();
    //     setMisclassifiedCells(data);
    //     return data;
    // };

    // useEffect(() => {
    //     let body;
    //     const fetchPairs = async () => {
    //         const response = await fetch('http://localhost:8000/api/pairs', {method: 'POST'});
    //         const data = await response.json();
    //         setMisclassifiedCells(data);
    //     };

    //     fetchPairs();
        
    // }, []);
    // console.log(misclassifiedCells);

    const handleToggleSelect = (index) => {
        setSelectedLines(prev => ({
            ...prev,
            [index]: !prev[index]
        }));
    };

    const handleOpenPopup = (imageIds) => {
        setSelectedImages(imageIds);
        setIsPopupOpen(true);
    };

    const handleClosePopup = () => {
        setIsPopupOpen(false);
    };

    return (
        <div>
            <h1>Top-100 misclassified cells:</h1>
            <div className="misclassified-list">
                {Object.entries(misclassifiedCells).map(([key, imageIds], index) => {
                    const [x, y] = key.replace(/[()]/g, '').split(', ').map(Number); // Convert x and y to numbers
                    const img = imageIds[0]
                    //console.log(x);
                    //console.log(y);
                    //console.log(key);
                    return (
                        <div key={index} className={`misclassified-line ${selectedLines[index] ? 'selected' : ''}`}>
                            <div className="cell-info">{`${x} predicted as ${y}`}</div>
                            <img src={`http://localhost:8000/topk_results/${x}.png`} alt={`Image ${x}`} className="larger-img" />
                            <img src={`http://localhost:8000/topk_results/${img}.png`} alt={`Image ${img}`} className="larger-img" />
                            <img src={`http://localhost:8000/topk_results/${y}.png`} alt={`Image ${y}`} className="larger-img" />
                            <div className="actions">
                                <button className="custom-btn" onClick={() => handleOpenPopup(imageIds)}>Check</button>
                                <button className="custom-btn" onClick={() => handleToggleSelect(index)}>
                                    {selectedLines[index] ? 'Cancel Select' : 'Select'}
                                </button>
                            </div>
                        </div>
                    );
                })}
            </div>
            <CheckPopup images={selectedImages} isOpen={isPopupOpen} onClose={handleClosePopup} />
            <p>Click <Link to="/input">here</Link> to start query!</p>
        </div>
    );
};

export default DataPreparation;
